import React, { Component } from 'react'
import "./App.css"

export default class App extends Component {
  render() {
    return (
      <div className='main'>
        <video loop autoPlay muted id="bg-video">
                <source src={(require('../assets/Messaoudi.mp4'))}></source>
            </video>
      </div>
    )
  }
}
